IT'S THE WEEKEND! I came across this recipie from @clarecooksfood and HAD to try this and wow! Soooo yum! Will make your kitchen smell delightful üòã 

My biscoff obsession has reached new levels üòÇ. The perfect way to start the weekend me thinks ü§§. 

Ingredients:

‚ù§ 140g blended oats
‚ù§ 1 tsp baking powder
‚ù§ 1 tsp cinnamon 
‚ù§ 120g biscoff spread
‚ù§ 1 tsp vanilla essence 
‚ù§ 50g brown sugar 
‚ù§ 50g granulated sweetener 
‚ù§ 30g melted coconut oil
‚ù§ 1 large egg
‚ù§ 2 medium bananas 

Method:

1. Blitz your oats, baking powder and cinnamon in a blender 
2. In a bowl mash your banana and mix with egg, coconut oil, brown sugar, sweetner, vanilla extract and biscoff spread 
3. Add dry ingredients and mix but don't over mix then pour into a lined bread tin
4. Bake at 180¬∞ for 55-60 mins (put tin foil over towards the end when browned on top). Enjoy!
